- input: "TEXT\x1CC00252551\x1C.TEXT\x1C\x1CF3XA\x1CIn response to RFIA letter dated
    2/22/2013,  Allocated expenses with the description of 'Auto-dials' were to remind
    Republicans to vote on election day. No candidates were identified. Allocated
    expenses with the discription of 'Internet advertising' were banner ads with the
    Republican logo. Items 38898/38900/98895/98893/38891/38887/38882/3888038877/3887538872/
    38872 are the values of in-kind contributions related to GOTV efforts .  Prior
    to these transactions, the escrow balance was  $14,506.55.  That amount was then
    reduced by the federal portion of the federal/Levin allocation of the in-kind
    contributions ($14,895.09 X 36% =  $5,362.23) leaving a new escrow balance of
    $9,144.32. Items 38898/38900 were from an in-kind from Atlas Hotels. This inkind
    combined with the previous month's inkind of $1,050 comes to a total of $11,950.
    However, because this effort is 36% federal, the true net contribution of $7,648
    does not exceed the Levin limit. Items 38653/38655 were paid with federally permissable
    funds. Items 38972/38970/38868/38869 were in-kinds from Fair and Open Comp. for
    the use of email lists intended for non-allocable FEA. This expense was paid with
    non-federal funds, reducing the escrow balance by the entire contribution amount
    of $1,050, leaving a new escrow balance of $8,094.32.\n"
